import React from 'react';
import './card.style.css'

export const Card = (props) => (
    <div className='card-container'> 
    <img 
    alt='house'
    src="images/${props.house.id}.jpg&size=180x180" />
    <h1> {props.house.name} </h1>
    </div>
)
